import { ArrowBackOutlined } from "@material-ui/icons"
import "./watch.scss"
import {useLocation} from 'react-router-dom'

export default function Watch() {
  const location = useLocation();
  const movie = location.movie;
  return (
    <div className="watch">
        <div className="back">
            <ArrowBackOutlined/>
            Home
        </div>
        <video
            className="video"
            muted
            autoPlay
            process
            controls
            src={location.video}
        />
    </div>
  )
}
